            notes: "Attempts to compute a mapping for the specified key and its current\n\
              \ mapped value (or null if there is no current mapping). For\n example,\
              \ to either create or append a String msg to a value\n mapping:\n\n\
              \  <code>\n map.compute(key, (k, v) -> (v == null) ? msg : v.concat(msg))</code>\n\
              \ (Method merge() is often simpler to use for such purposes.)\n\n If\
              \ the remapping function returns null, the mapping is removed\n (or\
              \ remains absent if initially absent).  If the remapping function\n\
              \ itself throws an (unchecked) exception, the exception is rethrown,\
              \ and\n the current mapping is left unchanged.\n\n The remapping function\
              \ should not modify this map during computation.\n\n This method will,\
              \ on a best-effort basis, throw a\n ConcurrentModificationException\
              \ if it is detected that the\n remapping function modifies this map\
              \ during computation."
